import React from 'react'
import Layout from '../components/Layout'

export default function blogs() {
    return (
        <>
            <Layout>
                <div className='container'>
                    <h1 className="yellow child">Most Recent Blogs</h1>
                </div>
            </Layout>
        </>
    )
}
